import React,{Component} from 'react';


class Nav extends Component {
  render() { 
    return (
     
      <div className="gnb">
        <ul>
            <li><a href="#none">퍼블리싱</a></li>
            <li><a href="#none">스크립트</a></li>
            <li><a href="#none">프론트엔드</a></li>
            <li><a href="#none">웹접근성</a></li>
            <li><a href="#none">블로그</a></li>
        </ul>
      </div>

    )  
  }
}
export default Nav;
